using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace CazamioNewProject.ApiHelpers.ApiObjects.ModlesApiObjects
{
    public class PaymentOptionsApi
    {
        public VenmoQrCodeInfo VenmoQrCode { get; set; }
        public AllowedPaymentMethodsInfo AllowedPaymentMethods { get; set; }

        public class VenmoQrCodeInfo
        {
            public string ScreeningFee { get; set; }
            public string HoldDepositBuilding { get; set; }
            public string HoldDepositApartment { get; set; }
        }

        public class AllowedPaymentMethodsInfo
        {
            public string CreditCard { get; set; }
            public string Ach { get; set; }
            public string DeliverCheck { get; set; }
            public string Zelle { get; set; }
            public string Venmo { get; set; }
        }

        public PaymentOptionsApi Generate()
        {
            string imageVenmoQrCodeScreeningFee = "data:image/jpeg;base64,";
            string imageVenmoQrCodeHoldDepositBuilding = "data:image/jpeg;base64,";
            string creditCard = "CreditCard";
            string ach = "ACH";
            string deliverCheck = "DeliverCheck";
            string zelle = "Zelle";
            string venmo = "Venmo";

            var paymentOptionsApi = new PaymentOptionsApi()
            {
                VenmoQrCode = new VenmoQrCodeInfo
                {
                    ScreeningFee = imageVenmoQrCodeScreeningFee,
                    HoldDepositBuilding = imageVenmoQrCodeHoldDepositBuilding,
                    HoldDepositApartment = ""
                },
                AllowedPaymentMethods = new AllowedPaymentMethodsInfo
                {
                    CreditCard = creditCard,
                    Ach = ach,
                    DeliverCheck = deliverCheck,
                    Zelle = zelle,
                    Venmo = venmo
                },
            };
            return paymentOptionsApi;
        }
    }
}
